import React from 'react';
import ItemCarousel from './ItemCarousel';
import BrandBoard from './BrandBoard';
import ProductBoard from './ProductBoard';
import DealsDisplay from './DealsDisplay';
function Home() {
    return (
       
            <div style={{ display: 'flex' }}>
            <BrandBoard />
            <ItemCarousel />   
            <ProductBoard /> 
            <div className=''>
            <DealsDisplay />   
            </div>    
        </div>
        
    )
}

export default Home
